using System;
using System.Linq;

namespace Xamarin.Examples.Demo.Showcase.VitalSignsMonitor
{
    public class DefaultVitalSignsDataProvider : DataProviderBase<VitalSignsData>
    {
        private const float SampleRate = 800f;

        private int _currentIndex = 0;
        private int _totalIndex = 0;
        private bool _isATrace = false;

        private readonly double[] _xValues;
        private readonly double[] _ecgHeartRate;
        private readonly double[] _bloodPressure;
        private readonly double[] _bloodVolume;
        private readonly double[] _bloodOxygenation;

        public DefaultVitalSignsDataProvider() : base(TimeSpan.FromMilliseconds(1))
        {
            var lines = VitalSignsTraces.Split("\r\n");

            var count = lines.Length;

            _xValues = new double[count];
            _ecgHeartRate = new double[count];
            _bloodPressure = new double[count];
            _bloodVolume = new double[count];
            _bloodOxygenation = new double[count];

            for (var i = 0; i < lines.Length; i++)
            {
                var split = lines[i].Split(',');

                _xValues[i] = Double.Parse(split[0]);
                _ecgHeartRate[i] = Double.Parse(split[1]);
                _bloodPressure[i] = Double.Parse(split[2]);
                _bloodVolume[i] = Double.Parse(split[3]);
                _bloodOxygenation[i] = Double.Parse(split[4]);
            }
        }

        protected override VitalSignsData OnNext()
        {
            if (_currentIndex >= _xValues.Length)
                _currentIndex = 0;

            var time = _totalIndex / SampleRate % 10;
            var ecgHeartRate = _ecgHeartRate[_currentIndex];
            var bloodPressure = _bloodPressure[_currentIndex];
            var bloodVolume = _bloodVolume[_currentIndex];
            var bloodOxygenation = _bloodOxygenation[_currentIndex];

            var data = new VitalSignsData(time, ecgHeartRate, bloodPressure, bloodVolume, bloodOxygenation, _isATrace);

            _currentIndex++;
            _totalIndex++;

            if (_totalIndex % 8000 == 0)
                _isATrace = !_isATrace;

            return data;
        }

        public (double, double) EcgHeartRateRange
        {
            get
            {
                return GetMinMax(_ecgHeartRate);
            }
        }

        public (double, double) BloodPressureRange
        {
            get 
            {
               return GetMinMax(_bloodPressure);
            }
        }

        public (double, double) BloodVolumeRange
        {
            get
            {
                return GetMinMax(_bloodVolume);
            }
        }

        public (double, double) BloodOxygenationRange
        {
            get
            {
                return GetMinMax(_bloodOxygenation);
            }
        }

        private static (double, double) GetMinMax(double[] values)
        {
            var min = values.Min();
            var max = values.Max();
            var growBy = Math.Abs(max - min) * 0.1;
            return (min - growBy, max + growBy);
        }

